            "lyric": "<p>Trong t&igrave;nh y&ecirc;u ai ai cũng c&oacute; t&igrave;nh đầu<br />\r\nCuộc t&igrave;nh đậm s&acirc;u hay chỉ l&agrave; t&igrave;nh tr&ocirc;ng xa<br />\r\nRồi bỗng một ng&agrave;y kh&ocirc;ng may rẽ hai lối đường<br />\r\nM&agrave; t&igrave;nh đậm s&acirc;u vết thương đ&acirc;u dễ n&agrave;o phai</p>\r\n\r\n<p><br />\r\nL&agrave; người con g&aacute;i chia tay sẽ đau hơn nhiều<br />\r\nRồi t&igrave;nh y&ecirc;u mới x&oacute;a vơi vết thương hằn s&acirc;u<br />\r\nCũng chẳng thể y&ecirc;n b&ecirc;n ai x&acirc;y đắp ngọt ng&agrave;o<br />\r\nV&igrave; người con g&aacute;i đ&acirc;u chỉ vết thương trong l&ograve;ng</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>T&igrave;nh cũ cũng đ&atilde; xa rồi, qu&aacute; khứ cũng đ&atilde; xa rồi<br />\r\nNhưng khi b&ecirc;n người mới em kh&ocirc;ng c&ograve;n l&agrave; người con g&aacute;i<br />\r\nV&igrave; ng&agrave;y ấy đ&atilde; sai lầm em suy nghĩ n&ocirc;ng cạn<br />\r\nGiờ người y&ecirc;u em phải chấp nhận th&ocirc;i</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>D&ugrave; đ&atilde; n&oacute;i bao lần nhưng em vẫn v&ocirc; hồn<br />\r\nCho d&ugrave; lời n&oacute;i anh kh&ocirc;ng quan trọng g&igrave; điều ấy<br />\r\nNgười vẫn thấy thắt trong l&ograve;ng<br />\r\nEm kh&ocirc;ng thấy an l&ograve;ng<br />\r\nNỗi l&ograve;ng con g&aacute;i khi y&ecirc;u l&agrave; thế.</p>",
